INSERT INTO `board` VALUES (11,4,0,1,0,'2011-10-12 14:21:31','管理者','nodata@nodata','このごろシステムに新しい機能を..','このごろシステムに新しい機能を追加しているので,<br />\r\n場合によって不明なエラーが発生する可能性があると思います。<br />\r\nそれを見つけたら、このページに書いてください。 <br />\r\n早いうちに修正し、円滑な作動を保つために努力します。',51,9,2,'115.137.253.89',2,1),(16,7,0,1,0,'2012-10-22 08:07:59','張　晶旭','nodata@nodata','社内用品発注依頼書システム(仮)開設中','<br />\r\n「社内用品発注依頼書システム」を(仮)開設しております。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n皆様のご意見があれば遠慮なく連絡下さい。<br />\r\n宜しくお願い致します。<br />\r\n<br />\r\n***点検期間： 2012年10月22日～2012年11月30日<br />',22,45,2,'115.137.253.89',2,1),(18,9,0,1,0,'2012-11-12 20:17:04','管理者','nodata@nodata',' 開発会議&QMSデータのページ部分のエラー修正。','開発会議&amp;QMSデータの<span style=\"font-family: &quot;MS UI Gothic&quot;,&quot;sans-serif&quot;; font-size: 12pt; mso-bidi-font-family: &rsquo;MS PGothic&rsquo;; mso-ansi-language: EN-US; mso-fareast-language: KO; mso-bidi-language: AR-SA\">「韓国臨床試験」ページ部分に<br />\r\nエラーがありましたが修正しました。<br />\r\n<br />\r\nこれからもよろしくお願いします。</span>',7,9,2,'115.137.253.89',2,1),(19,10,0,1,0,'2012-11-21 15:02:06','張　晶旭','nodata@nodata','(修正完了)開発会議&QMSデータのファイルアップロード容量件','開発会議&amp;QMSデータのファイルアップロード容量件<br />\r\n今まではアップロードする際、1回１０MBですが<br />\r\n11月21日から１００MBに増加しました。<br />\r\nご利用する際、不明な点があればご連絡お願い致します。<br />',4,45,2,'118.10.104.19',2,1),(20,11,0,1,0,'2012-11-22 01:02:44','張　晶旭','nodata@nodata','(新規開設)各種文書フォームを開設','各種文書フォーム システムを正式に開設しました。<br />\r\n宜しくお願いします。<br />',8,45,2,'115.137.253.89',2,1),(21,12,0,1,0,'2012-11-28 17:02:44','張　晶旭','nodata@nodata','社内用品発注依頼書のシステム運用開始お知らせ','＜　社内用品発注依頼書のシステム運用開始のお知らせ　＞<br />\r\n<br />\r\n運用開始：11月28日(水)　<br />\r\n利用方法：グループウェアの上端、社内用品発注依頼書をクリックして下さい。　　<br />\r\n　　　　　社内用品発注依頼書の最初ペイジに説明をのせております。<br />\r\n<br />\r\n＊疑問点やエラーが発生した場合、管理者の張に連絡下さい。<br />\r\n有難うございます。　　<br />\r\n　　　　　',21,45,2,'118.10.104.19',2,1),(27,14,0,1,0,'2013-01-18 15:22:39','張　晶旭','nodata@nodata','(テスト)ＣＰＣ','(テスト)ＣＰＣ',3,45,2,'1.115.99.71',2,2),(28,15,0,1,0,'2013-02-04 17:39:14','管理者','nodata@nodata','開発会議の [中分類]や [小分類]の入力部分','<p>開発会議の [中分類]や [小分類]の入力部分が、<br />\r\nコンピュータの機能によってうまくきかなかったようなので、入力の仕方を既存の方式にしました。</p>\r\n<p>参考して下さい。</p>',2,9,2,'115.137.253.89',2,1),(29,16,0,1,0,'2013-02-15 04:14:53','管理者','nodata@nodata','社内用品申請の追加部分 ','社内用品申請ページの追加部分にエラーがありまして、直してみました。&nbsp;<br />\r\n入力方式に戸惑うかもしれませんが、慣れてください。<br />\r\nどうぞよろしくお願いします。',7,9,2,'115.137.253.89',2,1);
