INSERT INTO `hitokoto` VALUES (1,'決裁管理 はいつから使えるんですか？','決裁管理 はいつから使えるんですか？<br />\r\n<br />\r\n<br />\r\n＝＝＝＝＝＝＝お答え＝＝＝＝＝＝＝＝＝＝<br />\r\nもうすぐできます。','2010-12-12 00:28:59',1,'管理者'),(2,'複数名が同一日程時の記載方法教えてください','複数の人が同じスケジュールを入力する場合、一つのイベントに対して人を追加する方法があればご教示ください。表示上、スケジュールが重複して見難いと思います。イベント情報が第一で、誰が参加するかは第二の重要事項と思います。<br />\r\n<br />\r\n====================お答え=====================<br />\r\nご意見有難うございます。<br />\r\n今のシステムは、一つのイベントに対して人を追加する機能はありません。<br />\r\nイベントに参加する本人が直接に入力するようになっておりますが、<br />\r\nご意見参考して見難くならないように改善します。','2010-12-16 09:00:44',1,'森山　剛'),(4,'誤記','カレンダーの火曜日の表示が『化』になっています。<br />\r\nBy tachi','2012-10-05 10:01:30',1,'舘　義人'),(5,'その他','開発会議＆QMSデータの「その他」を「化血研」に修正お願いします。<br />\r\nBy tachi..','2012-11-01 23:50:12',1,'舘　義人'),(7,'日程管理','１）いくつかの場所で、記入内容が２回連続して表示されています、たとえば、本日１／７の富樫さん記入の「半休」など、よろしくお願いします。<br />\r\n２）日程を新規作成する場合、カレンダの「月」がハングル表示になっています、修正等よろしくお願いします。<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n回答：上の内容は、解決しました。ご意見有難うございました。　','2013-01-07 13:29:12',1,'森山　剛'),(8,'バグやエラーなどの不具合について','GMP管理機器のニュー取説をアップロードする際、参照ボタンを押してもファイルをアップできず、セルの部分をダブルクリックすると、アップできるようになっています（木下）<br />\r\n<br />\r\n<br />\r\n回答：上の内容は、解決しました。ご意見有難うございました。　','2013-01-08 15:07:20',1,'木下　亜紀'),(9,'新規項目追加のお願い','試験番号管理のリストをupしたいです。ファイルはエクセルです。<br />\r\nよろしくお願いいたします。<br />\r\n（間）','2013-01-15 15:31:09',1,'間　靖子'),(10,'QRBのﾍﾟｰｼﾞ','QRBの議事録、資料をアップロードすることになったのですが、<br />\r\n中項目、小項目は編集できるのでしょうか？<br />\r\n<br />\r\n中項目はQRB開催日、小項目には資料or議事録かを選べるようにしたいです。<br />\r\n<br />\r\n<br />\r\n<br />\r\n回答：<font color=\"#007ac3\">(1)</font>カテゴリ選択にて、大分類を選択すると、<font color=\"#007ac3\">pop-upウィンドウーが現れ、中項目 ==&gt;小項目</font>が編集できます。<br />\r\n　　　　返事が遅くなり、本当にすみません。<br />','2013-01-17 17:47:44',1,'木下　亜紀'),(11,'GMP機器管理','取扱い説明書をUPするとエラーが表示されます。<br />\r\n結果、UPできません。<br />\r\n修正頂けないでしょうか。<br />\r\n<br />\r\n2013年1月23日　舘　義人<br />\r\n<br />\r\n回答：修正しました。実施日のところでエラーがあったんです。','2013-01-25 11:50:51',1,'舘　義人'),(12,'標準手順書の修正の仕方','ORM-03-011-０１　細胞充填工程の手順書が改訂されたので、<br />\r\n最新版に差し替えたいのですが、「修正する」のボタンをクリックすると、<br />\r\n手順書リストの画面に戻ってしまいました。<br />\r\n<br />\r\nアップする方法としては、<br />\r\n改訂版を再度登録し直す感じになるのでしょうか？<br />\r\n<br />\r\nその場合、旧ver.とリスト上は並んでいたほうが改訂されたことがわかりやすいと思います。<br />\r\n<br />\r\n以上、よろしくお願いします。<br />\r\n<br />\r\n木下<br />\r\n<br />\r\n回答：ファイルも変更できるように修正しました。','2013-01-28 10:13:49',1,'木下　亜紀'),(13,'標準手順書の参照方法','<p>細胞充填手順をアップしたのですが、ファイルが開かないようです。<br />\r\n<br />\r\n回答：パスワードを検証すると、ポップアップウィンドウが表示され、ファイルの作業ができます。<br />\r\n　　　これから、もっと便利に使えるように機能を駆使します。</p>','2013-01-28 11:11:20',1,'木下　亜紀'),(14,'標準作業手順書','開発部タブの標準作業手順書内にUPしているファイルが全て壊れているようです。<br />\r\n最近UPした、ファイル名の前に(0)がついているもののみ開くことができます。<br />\r\n<br />\r\n全てUPし直す方がいいですか？？','2013-02-22 15:39:55',1,'間　靖子'),(15,'製造記録書の画像フォルダのUPについて','標題の件、写真ファイルが日付ごとのフォルダに入っているため、フォルダごとアップできればと思うのですが、ご対応可能でしょうか？お手数をおかけいたしますが、ご検討よろしくお願いいたします。<br />\r\n<br />\r\n<br />\r\n回答：すみませんが、いまのシステムではフォルダごとのアップはできないんです。これから、それができるように研究してみます。<br />\r\n<br />\r\n承知しました。お手数をおかけいたしますが、お時間のあるときにご検討お願いします。','2013-03-04 10:40:27',1,'木下　亜紀'),(16,'製造記録書の写真ファイルのアップについて','たびたび恐れ入ります。<br />\r\n<br />\r\nフォルダをZipファイルに圧縮したところ、アップできそうな雰囲気でしたが、<br />\r\nアップ終了後に、エラーが発生してしまいました。<br />\r\n<br />\r\nご検討よろしくお願いいたします。<br />\r\n<br />\r\n<br />\r\n回答： 写真をZipファイルに圧縮してから、アップしてください。（笑）','2013-03-13 17:36:19',1,'木下　亜紀'),(25,'新しい機器の登録の方法','新しく機器登録をする際に、GMP機管理番号を入力できないようです。<br />\r\n<br />\r\n回答：<br />\r\n返信が遅くなりまして申し訳ございません。<br />\r\nお手数かけますが、修正ページにて管理番号を、書き直して下さい。<br />\r\n管理番号は、一応「GMP機」に修正しましたので、<br />\r\n全体目録の１ページで三個見えます。（ リストの一番上です）','2013-09-02 12:10:23',1,'木下　亜紀'),(28,'請求書申請管理','請求書の申請管理のページの登録者のPulldawnに【小松　希】を追加してください。お願いします。<img alt=\"heart\" height=\"20\" src=\"http://www.olympus-rms.com/ckeditor/plugins/smiley/images/heart.gif\" title=\"heart\" width=\"20\" /><br />\r\n<br />\r\n~回答：小松 様、返信が遅くなりまして申し訳ございません。','2014-11-10 13:05:03',1,'小松　希');
/*!40000 ALTER TABLE `hitokoto` ENABLE KEYS */;
UNLOCK TABLES;

