INSERT INTO `info_item` VALUES (1,2,1,2,'膝関節の構造は大腿骨、硬骨、鼻骨 など','<p><font size=\"2\">「構造」　</font></p>\r\n<div style=\"text-indent: 9pt\"><font size=\"2\">　大腿骨（Femur）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">硬骨（Tibia）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">鼻骨 （Fibula）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">膝蓋骨（Patella）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">大腿科（Femoral　condyle）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">骨膜（Periosteum）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">軟骨下骨（Subchondral　bone）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">軟骨 （Cartilage）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">硝子軟骨 （Hyaline cartilage）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">纎維軟骨 （Fibrocartilage）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">軟骨細胞 （Chondrocyte）...</font></div>','2010-03-21 03:33:10',1,1),(2,3,1,3,'軟骨は堅くて関節の骨末端をつやつやするように覆っている。','<p><font size=\"2\"><br />\r\n軟骨は堅くて関節の骨末端をつやつやするように覆っている。<br />\r\n骨関節炎というのは、軟骨がこわれて擦れられるようになること。<br />\r\n軟骨は 65～80%の水分を保持し、次の三つの成分になっている。</font>&nbsp;</p>\r\n<div style=\"text-indent: 9pt\"><font size=\"2\"><font color=\"#ff00ff\">*</font>　コラーゲン（collagen): 纎維性タンパク質</font></div>\r\n<div style=\"text-indent: 9pt\"><font size=\"2\"><font color=\"#ff00ff\">*</font>　プロテオグリカン(proteoglycans): タンパク質、糖、proteoglycanの本、<br />\r\n　　膠原質の網のみたいなものの混合体として骨格の継ぎ目のショックを吸収する役割をしている。</font>&nbsp;</div>\r\n<div style=\"text-indent: 9pt\"><font size=\"2\"><font color=\"#ff00ff\">*</font>　軟骨細胞(chondrocyte)</font></div>','2010-03-21 03:35:51',1,2),(3,5,4,5,'疼痛、ロッキング(locking)、摩擦音(crepitation)、むくみ','<div><font size=\"2\">疼痛、ロッキング(locking)、摩擦音(crepitation)、むくみ、不安定(giving way、buckling) などは<br />\r\n全層損傷の場合に特徴的であり、関節面によって圧痛がありうる。<br />\r\nまた、関節運動に制限があるかもしれない。<br />\r\nしかし大体的に軟骨病便に異なる膝関節病便は区分することが簡単ではない。</font></div>\r\n&nbsp;','2010-03-21 03:38:02',1,3),(4,6,4,6,'部分欠損（Partial thickness lesion）','<p><font size=\"2\"><br />\r\n１．部分欠損（Partial thickness lesion）<br />\r\n</font><font size=\"2\">　　軟骨下骨（Subchondral bone）までにはついてない関節軟骨病便</font>&nbsp;</p>\r\n<div><font size=\"2\">２．全層欠損（Full thickness lesion）</font></div>\r\n<div><font size=\"2\">　　軟骨下骨までには達しているが軟骨下骨を通ってない病便</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">３．骨軟骨欠損（Osteochondral lesion）</font></div>\r\n<div><font size=\"2\">　　軟骨下骨を含む病便<br />\r\n</font><font size=\"2\"><br />\r\n*スポーツに係った損傷にて全層欠損の頻度が高い。</font></div>','2010-03-21 03:39:51',1,4),(5,7,4,7,'理学的検査（Physical Examination）','<p><font size=\"2\">理学的検査（Physical Examination）</font></p>\r\n<div><font size=\"2\">* 大腿骨硬骨間の角を測定します。</font></div>\r\n<div><font size=\"2\">* 関節内滲出液の存在を確認します。</font></div>\r\n<div><font size=\"2\">* 膝関節関節運動範囲を測定します。</font></div>\r\n<div><font size=\"2\">* 膝関節異常音があるのか観察します。</font></div>\r\n<div><font size=\"2\">* 関節の不安定性に対して検査を行います。</font></div>','2010-03-21 03:40:50',1,5),(6,8,4,8,'**Outerbridge in 1961','<p><font size=\"2\"><br />\r\n**Outerbridge in 1961</font></p>','2010-03-21 03:41:43',1,6),(7,10,9,10,'年齢、痛みの性質による膝痛みの原因','<p><font size=\"2\"><br />\r\n膝の問題で病院を訪れる人々は大体膝痛みを訴えます。</font></p>\r\n<div><font size=\"2\">このような膝痛みは年齢、運動可否、外傷可否などによってその原因が異なる場合が多いです。</font></div>\r\n<div><font size=\"2\">膝の痛みを起こす原因となるのは、小児期、青年期、中・壮年期にてそれぞれの特徴があり、<br />\r\n患者の年齢、痛み部位、 臨床的所見、 放射線学的所見として大体識別ができます。</font></div>','2010-03-21 03:44:33',1,7),(8,10,9,10,'痛み・圧痛部位による原因','<p><font size=\"2\">膝の問題で病院を訪れる人々は大体膝痛みを訴えます。</font></p>\r\n<div><font size=\"2\">このような膝痛みは年齢、運動可否、外傷可否などによってその原因が異なる場合が多いです。</font></div>\r\n<div><font size=\"2\">膝の痛みを起こす原因となるのは、小児期、青年期、中・壮年期にてそれぞれの特徴があり、<br />\r\n患者の年齢、痛み部位、 臨床的所見、 放射線学的所見として大体識別ができます。</font></div>','2010-03-21 03:56:48',1,8),(9,7,4,7,'細胞治療剤とは？','細胞治療剤とは、細胞と組職の機能を修復させるために生きている自家(autologus)、<br />\r\n同種(allogenic)、異種(xenogenic)細胞を体外で増殖や選別など...','2010-10-22 16:20:12',1,9),(10,13,9,13,'関節炎痛症を減らす生活守則','1. 適当に運動をし、 規則的な生活をする。<br />\r\n2. 硬いベッドで寝るが、 軽くて暖かい布団を覆って楽に睡眠を取る。<br />\r\n3. 暑さ、寒さ、 湿り気などにすごく敏感なので細心な注意が必要。<br />\r\n4. 性生活は無理しない範囲内にする。<br />\r\n5. ひざまずいて正座する姿勢より椅子に座るほうが良い。...','2010-10-22 17:19:30',1,10);
/*!40000 ALTER TABLE `info_item` ENABLE KEYS */;
UNLOCK TABLES;

