INSERT INTO `news` VALUES (1,'TheraForm, received 510(k) clearance from the FDA','Sewon Cellontech has announced that TheraForm&trade; Standard and Sheet types have been cleared&nbsp;<br />\r\nfor marketing in the United States of America through the 510(k) Premarket Notification.&nbsp;<br />\r\nTheraform is intended for the management of wound dressings including partial and full-thickness wounds,<br />\r\n&nbsp;various ulcers, surgical wounds, trauma wounds and draining wounds. <br />\r\nAlong with Standard and Sheet types, TheraForm Bilayer and Plug types are also&nbsp;<br />\r\nexpected to be cleared 510(k) Premarket Notification within few months.&nbsp;','2010-03-21 04:10:19',1);
